import styles from './Card.module.css'

export default function Card(props) {
   return (
      <div className={styles.card}>
         <img  src={props.image} alt="" />
         <button onClick={props.onClose}>X</button>
         <h4>{props.name}</h4>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>

      </div>
   );
}
